function AdminOrderInfo({order}) {
    return (
      <Routes>
        {orders.data.OrderFind.map((order) => {
          return (
            <Route
              path={location.pathname + "/" + order._id}
              element={<>{order._id}</>}
              key={"route" + order._id}
            />
          );
        })}
      </Routes>
    );
}
export default AdminOrderInfo;
